import axios from "axios"
import { useEffect } from "react"
import { getAllUsers } from "../../../../CinemaWS/repositories/userRepo"

const ManageUsers = () => {

    useEffect(() => {
        getUsers()
    }, [])

    const getUsers = async () => {
        const {data} = await axios.get(`${process.env.REACT_APP_CINEMAWS}/users`);
    }

    return (
        <div style={{border: '1px solid black', width: '75%', margin: '20px auto'}}>
            <h1>Users</h1>
            <button style={{marginRight: '10px'}}>All Users</button>
            <button>Add User</button>
        </div>
    )
}

export default ManageUsers
